import React from "react";
import { Container, styleButton } from '../style.js';
import { Link } from  "react-router-dom";

const MainPage = (props) => {
  return (
    <Container>
      <span>메인 페이지</span>
      <Link style={styleButton} to="/board">공지사항</Link>
    </Container>
  );
};

export default MainPage;
